package com.example.userschool.model;public class Absece {    private int id;    private int studentID;    private String SbujectName;    private int subjectID;    private int found;    private String date;    public Absece(String sbujectName, int found, String date) {        SbujectName = sbujectName;        this.found = found;        this.date = date;    }    public Absece(int id) {        this.id = id;    }    public Absece(int id, int studentID, int subjectID, int found, String date) {        this.id = id;        this.studentID = studentID;        this.subjectID = subjectID;        this.found = found;        this.date = date;    }    public Absece() {    }    public String getSbujectName() {        return SbujectName;    }    public void setSbujectName(String sbujectName) {        SbujectName = sbujectName;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public int getStudentID() {        return studentID;    }    public void setStudentID(int studentID) {        this.studentID = studentID;    }    public int getSubjectID() {        return subjectID;    }    public void setSubjectID(int subjectID) {        this.subjectID = subjectID;    }    public int isFound() {        return found;    }    public void setFound(int found) {        this.found = found;    }    public String getDate() {        return date;    }    public void setDate(String date) {        this.date = date;    }}